INSERT INTO `product` (`createdAt`, `id`, `price`, `initialPrice`, `quantity`, `image`, `category`, `content`, `brand`, `productName`) VALUES
	('2023-02-07 02:07:38.744981', 1, 29290000, 20000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/f5/52/80/675e31a670afc560e7b0e46c0b65fb4f.png.webp', 'điện thoại', 'iPhone 14 Pro Max. Bắt trọn chi tiết ấn tượng với Camera Chính 48MP. Trải nghiệm iPhone theo cách hoàn toàn mới với Dynamic Island và màn hình Luôn Bật. Công nghệ an toàn quan trọng – Phát Hiện Va Chạm1 thay bạn gọi trợ giúp khi cần kíp', 'apple', 'Apple iPhone 14 Pro Max'),
	('2023-02-07 02:09:53.731097', 2, 155000, 110000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/9b/4b/8a/04ffa4c4673af50ef2e594bf8e4f6fa1.jpg.webp', 'sách', 'Tác phẩm Muôn Kiếp Nhân Sinh tập 1 của tác giả Nguyên Phong xuất bản giữa tâm điểm của đại dịch đã thực sự tạo nên một hiện tượng xuất bản hiếm có ở Việt Nam. Cuốn sách đã khơi dậy những trực cảm tiềm ẩn của con người, làm thay đổi góc nhìn cuộc sống và thức tỉnh nhận thức của chúng ta giữa một thế giới đang ngày càng bất ổn và đầy biến động. Ngoài việc phát hành hơn 200.000 bản trong 6 tháng, chưa kể lượng phát hành Ebook và Audio Book qua Voiz-FM, First News còn nhận được hàng ngàn tin nhắn, e-mail chuyển lời cảm ơn đến tác giả Nguyên Phong. Điều này chứng tỏ sức lan tỏa của cuốn sách đã tạo nên một hiện tượng trong văn hóa đọc của năm 2020.', 'sách', 'Muôn Kiếp Nhân Sinh 2 tiếng anh'),
	('2023-02-07 02:11:06.246301', 3, 1794000, 800000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/c7/62/c4/aaf48bba32370d02ea0bbb255a304f54.jpg.webp', 'giày nữ', 'Giày nam Pierre Cardin PCMFWLG 762  được sản xuất từ 100% da thật nhập khẩu với kiểu thiết kế giày không dây giúp cho trang phục của bạn thêm phần sang trọng, lịch lãm. Đế giày được làm từ cao su thiên nhiên tránh trơn trượt, thiết kế ôm chân tự tin khi cất bước. Giày da Pierre Cardin phù hợp với nơi công sở hay gặp mặt đối tác, khẳng định vị thế quý ông.\r\n', 'giày nữ', 'Giày tây nam Pierre Cardin búp bê - PCMFWLG 762'),
	('2023-02-07 02:12:25.740611', 4, 899000, 500000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/ec/dd/ec/973a5d5ebe694ebd9a99c19f73a8f15c.jpg.webp', 'đồ nam', '+ Xuất xứ: Nhập khẩu Quảng Châu\r\n\r\n+ Bộ Quần áo Lính dạng hộp độc đáo, phong cách lính khỏe khoắn, mạnh mẽ.', 'đồ nam', 'Bộ Quần Áo KaKi Lính Mỹ US ARMY U569 Kiểu Dáng Túi Hộp Chiến Thuật, có size lớn'),
	('2023-02-07 02:13:26.222286', 5, 958000, 540000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/93/56/54/c871a8c47b26dd78ea52da80d9532818.jpg.webp', 'đồ nam', '- Thiết kế:\r\n\r\n+ Áo : Cổ đứng bo tay sử dụng bo dệt gấu chun ôm vừa giữ ấm cơ thể điểm nhấn khóa kéo màu trắng linh hoạt phía trước thiết kế túi thẳng hai bên tiện lợi\r\n\r\n+ Thêu logo B trước ngực áo khẳng định thương hiệu.\r\n\r\n+ Quần : cạp chun quần ôm thoải mái, bo gấu sử dụng bo dệt điểm nhấn khóa kéo màu trắng + dây dệt 2 màu đỏ đen ở túi sau', 'đồ nam', 'Bộ thể thao nam Biluxury bộ khoác gió chất liệu cao cấp chống nhăn nhàu phom dáng thể thao khỏe khoắn 6AGBT003DEN'),
	('2023-02-07 02:13:40.350467', 6, 818000, 487000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/3f/90/a0/4fc82858148aa406ace3b9decf828996.jpg.webp', 'đồ nam', '- Thiết kế:\r\n\r\n+ Phom dáng: slim fit với độ ôm vừa tôn dáng giúp người mặc tự tin thoải mái trong mùa thu đông này\r\n\r\n+ Áo:\r\n\r\nThiết kế basic, phối bo tay mới lạ, đường bổ ngang thân tạo cảm giác mới lạ. Đường bổ ngang thân tạo cảm giác khỏe khoắn cho người mặc . Logo thêu ở ngực áo tạo điểm nhấn và khẳng định thương hiệu\r\n\r\n+ Quần:\r\n\r\nQuần thiết kế có túi cơi khóa 2 bên thân trước và túi cơi sau che khóa tiện lợi. Sử dụng dây rút cạp chun co dãn linh hoạt\r\n\r\nLogo thêu dưới miệng túi khẳng định thương hiệu', 'đồ nam', 'Bộ nỉ thể thao nam Biluxury 6ANKT005GHS thiết kế basic có khóa kéo phom ôm vừa mang lại vẻ ngoài trẻ trung năng động'),
	('2023-02-07 02:14:55.112127', 7, 194000, 80000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/50/15/00/e8d7639eab17bb35feb1ca098e1d8178.jpg.webp', 'đồ nam', 'Quần Short thoáng mát, cá tính, tạo nên sự trẻ trung đối với những người đam mê thời trang đường phố\r\n\r\nThông tin sản phẩm\r\n\r\nXuất xứ: Từ xưởng may có kinh nghiệm tại Việt Nam\r\n\r\nChất liệu:100% cotton thoáng mái thoải mái, phù hợp các hoạt động ngoài trời, vui chơi\r\n\r\nThiết kế form rộng với đường may tỉ mỉ: trẻ trung, năng động, dễ phối đồ, thích hợp cho cả nam và nữ trong hoạt động thể thao\r\n\r\n- Hàng có sẵn, giao hàng ngay khi nhận được đơn\r\n\r\n- Hoàn tiền nếu sản phẩm không giống với mô tả', 'đồ nam', 'Quần unisex nam chất thun mềm mịn mát có bigsize đến 100kg ép logo cực chất'),
	('2023-02-07 02:16:20.238530', 8, 295000, 110000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/81/5e/41/2906b6d70d6f8c6be9c51f0ff0b1ae91.jpg.webp', 'đồ nam', 'Quần jogger nam thể thao Perfection nỉ lông cừu cao cấp phong cách đường phố hàn quốc H2073\r\n\r\nHƯỚNG DẪN CHỌN SIZE\r\n\r\n* Xem bảng size chi tiết, số đo sản phẩm trên ảnh\r\n\r\nTHÔNG TIN SẢN PHẨM\r\n\r\n- Chất vải nỉ lông cừu cao cấp ấm áp, vải mềm mịn thoải mái khi mặc\r\n\r\n- Kiểu dáng thể thao, dễ mặc, dễ phối đồ\r\n\r\n- Phù hợp mặc đi chơi, đi dạo, đi làm, tập thể dụ\r\n\r\n- Màu sắc: Đen, Trắng, Xám, Xanh dương', 'đồ nam', 'Quần jogger nam thể thao Perfection nỉ lông cừu cao cấp phong cách đường phố hàn quốc H2073'),
	('2023-02-07 02:17:02.164142', 9, 73000, 20000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/a5/e6/a0/55f0123d0638f7c15c487c9991c16e8e.jpg.webp', 'đồ nam', 'ÁO Anime MAnga IN HÌNH THEO YÊU CẦU\r\n\r\nMÔ TẢ SẢN PHẨM : ÁO Manga - ÁO ANIME CỰC ĐỘC\r\n\r\n️ Chất liệu: áo thun co giãn 4 chiều.\r\n\r\n️ Hình in chuyển nhiệt Không bong tróc.\r\n\r\n️ Tạo sự khác biệt, thể hiện cá tính và đầy phong cách.\r\n\r\n️ Có thể mặc đi chơi cùng bạn bè, cùng team…\r\n\r\n️ Nam & Nữ đều mặc được.', 'đồ nam', 'Áo phông nam nữ trắng - Áo phông nam big size - Mẫu Áo phông cho người béo'),
	('2023-02-07 02:17:47.637379', 10, 73000, 20000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/9e/12/50/e86b5a87bc57ad10106327fa0b4c601a.jpg.webp', 'đồ nam', 'ÁO Anime MAnga IN HÌNH THEO YÊU CẦU\r\n\r\nMÔ TẢ SẢN PHẨM : ÁO Manga - ÁO ANIME CỰC ĐỘC\r\n\r\n️ Chất liệu: áo thun co giãn 4 chiều.\r\n\r\n️ Hình in chuyển nhiệt Không bong tróc.\r\n\r\n️ Tạo sự khác biệt, thể hiện cá tính và đầy phong cách.\r\n\r\n️ Có thể mặc đi chơi cùng bạn bè, cùng team…\r\n\r\n️ Nam & Nữ đều mặc được.', 'đồ nam', 'HOT Áo Phông &M Boku no Hero Academia Katsuki Bakugo Skull mẫu mới cực chât'),
	('2023-02-07 02:18:18.273555', 11, 205000, 110000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/89/d3/24/cf1adff7f10d6c58d82ed66f4cd25250.jpg.webp', 'đồ nữ', 'Phong cách: Tính cách Nữ / Gợi cảm;\r\n\r\nCác yếu tố / Thủ công mỹ nghệ phổ biến: Các nút Màu đồng nhất;\r\n\r\nHình thức kết hợp: Một mảnh;\r\n\r\nKiểu dáng: Váy chữ A;\r\n\r\nChiều dài tay áo: Dài tay;\r\n\r\nChiều dài váy: Váy Midi;\r\n\r\nKiểu cổ áo: Cổ chữ V;\r\n\r\nCó thêm nhung: Không có nhung;', 'đồ nữ', 'Áo Sơ Mi Tay Dài Phong Cách Hàn Quốc Thời Trang Mùa Thu Mới Cho Nữ'),
	('2023-02-07 02:18:42.131946', 12, 510000, 210000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/8e/66/04/03777692523aa4591c2ba26a7382a3ec.jpg.webp', 'đồ nữ', 'Phong cách: Tính cách Nữ / Gợi cảm;\r\n\r\nCác yếu tố / Thủ công mỹ nghệ phổ biến: Các nút Màu đồng nhất;\r\n\r\nHình thức kết hợp: Một mảnh;\r\n\r\nKiểu dáng: Váy chữ A;\r\n\r\nChiều dài tay áo: Dài tay;\r\n\r\nChiều dài váy: Váy Midi;\r\n\r\nKiểu cổ áo: Cổ chữ V;\r\n\r\nCó thêm nhung: Không có nhung;', 'đồ nữ', 'Đầm Dài Tay Cổ Chữ V Phong Cách Hepburn Cao Cấp Thời Trang Xuân Thu Kiểu Mới Cho Nữ'),
	('2023-02-07 02:19:15.235437', 13, 199000, 46000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/33/b6/f0/fe305297096988cf820f4febf6caad0c.png.webp', 'đồ nữ', '- Kiểu dáng: Váy thiết kế cài cúc dáng dài\r\n- Chất liệu:Kaki, chất mát không nhăn\r\n- Đường may tỉ mỉ, chắc chắn, không chỉ thừa\r\n- Thiết kế hiện đại, trẻ trung, năng động\r\n- Xuất xứ: Việt Nam\r\n- Chịu trách nghiệm sản phẩm: ChunChun Store - Thời trang nữ thiết kế\r\n- Năm sản xuất: 2022', 'đồ nữ', 'Váy sơ mi V41 tay bồng, có 2 túi trước, dáng váy dài siêu tôn dáng'),
	('2023-02-07 02:19:51.877290', 14, 215000, 60000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/f2/c4/f3/b4575141815a7c9986136b1eb158874d.png.webp', 'đồ nữ', '1. Chất liệu mềm mại, nhẹ nhàng và thoải mái.\r\n\r\n2. Dành cho bữa tiệc, bãi biển, buổi tối, câu lạc bộ, kỳ nghỉ, du lịch,\r\n\r\n3. Mặc siêu thoải mái, kiểu dáng độc đáo, giúp bạn đẹp hơn, thời trang, gợi cảm và thanh lịch.', 'đồ nữ', 'Đầm body cổ tròn dài tay cúc bấm dáng dài qua gối tôn dáng màu đen hàng có sẵn tại Hana Store'),
