	('2023-02-07 02:20:56.521836', 16, 210000, 60000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/01/4d/4d/4376ac4b1bbfd958af69d59049561ff4.jpg.webp', 'đồ nữ', 'Thương hiệu thời trang công sở từ 2013\r\n\r\n- Sáng lập bởi Ông LEE YUN HYEONG từ Hàn Quốc và Bà ĐỒNG THỊ DIỄM TRANG là người Việt Nam\r\n\r\n- Sau gần 10 năm hoạt động công ty đã có:\r\n\r\n+ 15 showrooms trên toàn quốc\r\n\r\n+ Hơn 30 đại lí phân phối độc quyền\r\n\r\n- Tầm nhìn chiến lược trong tương lai:\r\n\r\n+ NK sẽ phủ sóng các showrooms trong nước\r\n\r\n+ Phát triển thêm dòng hàng cao cấp tại trường Việt Nam và mở rộng thị trường Hàn Quốc.', 'đồ nữ', 'Áo Sơ Mi Cổ Tàu Tay Bồng NK FASHION Thiết Kế Đơn Giản Trơn Màu Trẻ Trung '),
	('2023-02-07 02:21:36.561253', 17, 520000, 300000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/30/6d/23/d033f20a2d9b668596505ed104019d6e.jpg.webp', 'đồ nữ', 'Váy Thiết Kế Jane Dress được làm từ chất liệu vải nhung nhập khẩu cao cấp đính kết ngọc, chất vải dày dặn, lên phom dáng tốt, hạn chế nhăn nhàu.\r\n\r\nII. Bảng Size của Đầm Thiết Kế Jane Dress Chất Liệu Vải Nhung Cao Cấp Đính Ngọc - Váy Thiết Kế Sang Trọng Thanh Lịch:\r\n\r\nSize S: Từ 40-49kg, Ngực <86cm, Eo <68cm\r\n\r\nSize M: Từ 50-54kg, Ngực <90cm, Eo <72cm\r\n\r\nSize L: Từ 55-60kg, Ngực <94cm, Eo <78cm\r\n\r\nSize XL: Từ 61-70kg, Ngực <100cm, Eo <85cm\r\n\r\nIII. CÔ NÀNG CÔNG SỞ - DESIGN cam kết:\r\n\r\n- Ảnh được chụp trên Jane Dress của CÔ NÀNG CÔNG SỞ - DESIGN.\r\n\r\n- Trả hàng 100% nếu sản phẩm không đúng như ảnh.', 'đồ nữ', 'Đầm Thiết Kế Jane Dress Chất Liệu Vải Nhung Cao Cấp Đính Ngọc - Váy Thiết Kế Sang Trọng Thanh Lịch'),
	('2023-02-07 02:25:04.919997', 18, 540000, 210000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/46/fc/8d/f7738ed076db478c9972cfa707d80000.jpg.webp', 'đồ nữ', 'Đầm thiết kế tinh tế ,sang trong\r\nLà sự lựa chọn vô cùng hoàn hảo dành cho các bạn gái , mang đến cho các bạn gái vẻ ngoài đáng yêu , nữ tính và năng động .\r\nThích hợp mặc đi tiệc hay dạo phố cùng bạn bè .\r\nMàu sắc trẻ trung , dễ dàng phối cùng các phụ kiện thời trang đi kèm', 'đồ nữ', 'ĐẦM BODY VOAN HOA ĐUÔI CÁ CAO CẤP'),
