	('2023-02-07 02:26:54.843162', 21, 278000, 20000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/8e/f1/8c/0a0a58cfdcbd11f87eaa263e2de01374.jpg.webp', 'sách', 'Từ lâu 999 LÁ THƯ GỬI CHO CHÍNH MÌNH đã trở thành cuốn sách "must-have" trên tủ sách của mỗi người bởi cảm hứng sống cùng nguồn năng lượng tích cực mà nó mang lại, cũng như sự dễ chịu đến từ nội dung mang tính nhân văn và sâu sắc. Cho đến nay, “999 lá thư gửi cho chính mình” đã chính thức ra mắt độc giả dưới hai phiên bản nổi bật nhất gồm phiên bản tiếng Việt (bìa mềm phổ thông và bìa cứng) + phiên bản song ngữ Trung – Việt (bìa mềm), và giờ đây, với mong muốn mang đến sự tươi mới và năng động hơn, Vanvietbooks xin được ra mắt các độc giả trẻ bộ 10 tập sách “999 LÁ THƯ GỬI CHO CHÍNH MÌNH” – Phiên bản sổ tay mini, được thiết kế theo phong cách trẻ trung, sáng tạo, thích hợp cho mọi đối tượng và thuận tiện cho việc bỏ túi để mang theo.', 'sách', '"999 Lá Thư Gửi Cho Chính Mình” - Phiên Bản Mini tiếng việt'),
	('2023-02-07 02:27:16.800491', 22, 98000, 45000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/00/05/84/5c97db78fca10504d05a20f3e5215c1c.jpg.webp', 'sách', '“Chớ hoang mang, chuyện gì cũng có cách lo toan” – dù khó khăn đến đâu, thì chỉ cần “niệm thần chú” này, bạn sẽ thành công dù ở bất cứ lĩnh vực nào.\r\nĐược viết bởi Marie Forleo, một người vô cùng thông minh, dễ gần và năng nổ, Chớ hoang mang, chuyện gì cũng có cách lo toan là một cuốn sách dễ đọc, truyền cảm hứng, đôi khi hài hước nhưng mang thông điệp rõ ràng: Bạn có thể làm bất cứ điều gì bạn thực sự muốn, chỉ cần kiên trì và sẵn sàng nổ lực để thực hiện nó.', 'sách', 'Chớ Hoang Mang Chuyện Gì Cũng Có Cách Lo Toan - Marie Forleo - tiếng việt'),
	('2023-02-07 02:27:41.737644', 23, 14000, 4000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/c3/8d/24/64e24c077651d0280e5ef9fb82b2d8a5.jpg.webp', 'sách', 'Chúng ta không giây phút nào không bị thế giới bên ngoài chỉ trỏ, lâu dần sẽ quên mất tâm tư ban sơ, mất đi khả năng suy nghĩ độc lập và giữ vững cái tôi.\r\n\r\nSo với từng câu từng câu an ủi dịu dàng, tôi nghĩ chúng ta cần một chậu nước lạnh hơn. Nó sẽ giúp chúng ta tỉnh táo ý thức được tính tình cáu bẳn của mình, tầm nhìn và lòng dạ hạn hẹp của mình, EQ thấp của mình, và tất cả những vấn đề mà bản thân chúng ta không nhìn rõ, nhưng người khác thấy rõ mồn một mà không muốn nói cho chúng ta biết.', 'sách', 'Lòng Tốt Của Bạn Cần Thêm Đôi Phần Sắc Sảo tiếng việt'),
	('2023-02-07 02:28:03.706161', 24, 78000, 30000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/05/08/bc/288f0f60ba5713c3075ceb7a619a1939.jpg.webp', 'sách', 'Tiểu thuyết Nhà giả kim của Paulo Coelho như một câu chuyện cổ tích giản dị, nhân ái, giàu chất thơ, thấm đẫm những minh triết huyền bí của phương Đông. Trong lần xuất bản đầu tiên tại Brazil vào năm 1988, sách chỉ bán được 900 bản. Nhưng, với số phận đặc biệt của cuốn sách dành cho toàn nhân loại, vượt ra ngoài biên giới quốc gia, Nhà giả kim đã làm rung động hàng triệu tâm hồn, trở thành một trong những cuốn sách bán chạy nhất mọi thời đại, và có thể làm thay đổi cuộc đời người đọc.', 'sách', 'Nhà Giả Kim tiếng anh'),
	('2023-02-07 02:28:55.788452', 25, 135000, 50000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/c9/e4/18/a9cfc425fa590c453f20307229804bb3.jpg.webp', 'sách', 'Câu chuyện bắt đầu từ một chuyến bay trong ngày mưa ảm đạm, một người đàn ông 37 tuổi chợt nghe thấy bài hát gắn liền với hình ảnh người yêu cũ, thế là quá khứ ùa về xâm chiếm thực tại. Mười tám năm trước, người đàn ông ấy là chàng Toru Wanatabe trẻ trung, mỗi chủ nhật lại cùng nàng Naoko lang thang vô định trên những con phố Tokyo. Họ sánh bước bên nhau để thấy mình còn sống, còn tồn tại, và gắng gượng tiếp tục sống, tiếp tục tồn tại sau cái chết của người bạn cũ Kizuki. Cho đến khi Toru nhận ra rằng mình thực sự yêu và cần có Naoko thì cũng là lúc nàng không thể chạy trốn những ám ảnh quá khứ, không thể hòa nhập với cuộc sống thực tại và trở về dưỡng bệnh trong một khu trị liệu khép kín. Toru, bên cạnh giảng đường vô nghĩa chán ngắt, bên cạnh những đêm chơi bời chuyển từ cảm giác thích thú đến uể oải, ghê tởẫn kiên nhẫn chờ đợi và hy vọng vào sự hồi phục của Naoko. Cuối cùng, những lá thư, những lần thăm hỏi, hồi ức về lần ân ái duy nhất của Toru không thể níu Naoko ở lại, nàng chọn cái chết như một lối đi thanh thản. Từ trong mất mát, Toru nhận ra rằng mình cần tiếp tục sống và bắt đầu tình yêu mới với Midori.', 'sách', 'Rừng Nauy tiếng anh'),
	('2023-02-07 02:29:24.356303', 26, 172000, 60000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/b2/01/d3/558095f027444a6b9a1e50d483f48e9c.jpg.webp', 'sách', '"Tiếp nối cuốn tiểu thuyết nổi tiếng HAI SỐ PHẬN về William Kane và Abel Rosnovski, Đứa con gái hoang đàng là một câu chuyện được chắp bút của thế hệ tiếp theo. Câu chuyện đầy trớ trêu, trắc trở nhưng đầy nhân văn.\r\n\r\nTƯƠNG LAI CỦA CÔ LÀ THAM VỌNG\r\n\r\nFlorentyna Rosnovski – con gái Abel – với một ý chí sắt đá di truyền từ người cha, cô quyết tâm theo đuổi mục tiêu và lý tưởng của mình, đó là trở thành nữ Tổng thống Mỹ đầu tiên. Tuy thế, cuộc đời của cô, cũng giống như người cha của mình, cũng gặp vô cùng nhiều trắc trở mà người phụ nữ tham vọng này nhất định phải vượt qua.', 'sách', 'Đứa Con Gái Hoang Đàng - Hai Số Phận - Phần II tiếng việt'),
	('2023-02-07 02:29:50.609668', 27, 150000, 40000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/8b/ac/5e/b984b10d691ecd7271f985c442982a28.jpg.webp', 'sách', 'Chu Triều Dương, cậu học sinh có thành tích học tập xuất sắc nhất toàn trường cấp 2. Phổ Phổ và Đinh Hạo bỏ trốn khỏi cô nhi viện và đến tìm cậu để ở nhờ.\r\n\r\nBa đửa trẻ tình cờ quay được đoan video Trương Đống Thăng giết bố mẹ vợ anh ta và tiến hành tống tién. Chu Triều Dương vô tình ngộ sát đứa em gái cùng cha khác mẹ, lúc đó chí éo Phổ Phổ và Đinh Hạo chứng kiến.\r\n\r\nBà mẹ kế nghi ngờ cậu chính là hung thủ nên dã tìm mọi cách trả thù cậu. Cảnh sát hoàn toàn không nghi ngờ gì Chu Triều Dương nhưng vẫn luôn tìm kiếm tung tích của kẻ giết chết Chu Tinh Tinh và đã dần điêu tra được một số manh mối.\r\n\r\nLiệu Chu Triều Dương sẽ xử trí ra sao? Mối quan hệ giữa ba đứa trẻ và Trương Đống Thăng sẽ diễn biến như thế nào? Liệu Trương Đống Thăng có thể thực hiện được kế hoạch của anh ta một cách thuận lợi?', 'sách', 'Đứa Trẻ Hư (Tái Bản) tiếng việt'),
	('2023-02-07 02:30:14.400003', 28, 106000, 40000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/71/3f/e5/a8a9d55f24bebc45dc7e8d6d2b8b6bef.jpg.webp', 'sách', 'Thất Lạc Cõi Người (Tái Bản 2022)\r\nGiá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....', 'sách', 'Thất Lạc Cõi Người (Tái Bản 2022) tiếng việt'),
	('2023-02-07 02:30:42.442120', 29, 94000, 41000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/0c/45/44/10ea9b902a56a35d1f126520fd690656.jpg.webp', 'sách', '"Mọi việc ở đời có bao giờ diễn ra như ta vẫn tưởng, nhưng biết làm sao. Cuộc đời đem cho ta cái gì thì ta phải nhận cái đó và chỉ còn cách làm cho chúng tốt đẹp nhất mà thôi."\r\n\r\nCuộc đời của Pi mở đầu với lời chào ấn tượng của tác giả, Yan Martel và hành trình tưởng như bế tắc khi ông mò mẫm đi tìm một câu chuyện cho sự nghiệp của mình. Lời chào ngắn ngủi ấy giúp người đọc hình dung được hoàn cảnh ra đời của cuốn sách và chẳng cần thắc mắc gì nhiều đến bối cảnh của câu chuyện. Và như thế, một Ấn Độ từ những năm 60, 70 của thế kỷ trước sống dậy cùng Pi, cùng vườn thú Poddicherry và cùng những ngày thơ ấu rối rắm và kỳ lạ.\r\n\r\nPiscine Molitor Patel, hay bị gọi nhầm thành Pissing cho đến khi cậu tự đặt cho mình biệt danh Pi - con số 3,14 huyền thoại. Ngẫu nhiên thay, cái tên ấy cùng những biến cố sau này đã biến cuộc đời Pi trở thành huyền thoại. Mà ngay cả nếu không phải huyền thoại thì Pi đã là một cậu bé kỳ lạ, đứa trẻ lớn lên cùng những người bạn trong vườn thú và có niềm tin mạnh mẽ vào Thượng đế. Chắc hẳn trên thế giới này, Pi là cậu bé duy nhất theo đến ba tôn giáo: Hindu, đạo Hồi và đạo Cơ đốc. Trong con người Pi, tôn giáo cũng như dân tộc, như quốc tịch và nếu như chúng ta đều tôn thờ Thượng đế thì tại sao lại không thể tin theo nhiều đạo.', 'sách', 'Cuốn sách đã được chuyển thể thành phim: Cuộc đời của Pi(tái bản)'),
	('2023-02-07 02:31:17.510354', 30, 94000, 41000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/54/95/cd/0eb5401578da23955911f6677c07a8a5.jpg.webp', 'sách', 'Phần lớn loài hải âu không muốn tìm hiểu gì thêm ngoài việc làm sao để bay từ bờ đi kiếm ăn rồi bay trở về. Đối với hầu hết hải âu, ăn quan trọng hơn là bay. Nhưng riêng với chàng hải âu Jonathan Livingston, niềm say mê bay lại lớn hơn tất cả mọi thứ khác trên đời.\r\nCuốn truyện “Chàng hải âu kỳ diệu” của nhà văn nổi tiếng người Mỹ - Richard Bach sẽ kể cho chúng ta về cuộc đời của Jonathan, một chàng hải âu mà niềm say mê bay lớn hơn tất cả mọi thứ khác trên đời. Chàng tập bay với nhiều tư thế khác nhau, bay với tốc độ cao, bay ở thế nhào lộn, Nhưng đàn hải âu lại không thích chàng làm như thế, chúng coi đó là nỗi nhục nhã, bỏ mặc chàng trong sự cô đơn. Ngay cả bố mẹ của Jonathan cũng tỏ ra lo lắng trước việc chú suốt ngày đơn độc một mình, hàng trăm lần tập đi tập lại những đường bay chậm là là mặt nước. Nhưng điều đó không làm chàng nản chí, vì sự thật là những con hải âu khác sẽ không bao giờ biết được vẻ đẹp và cảm giác vĩ đại khi bay.', 'sách', 'Sách Tủ Sách Đời Người - Chàng Hải Âu Kỳ Diệu - Richard Bach - Alphabooks - BẢN QUYỀN'),
	('2023-02-07 02:31:36.794458', 31, 135000, 41000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/0c/53/56/d6742232447ee8d685ec97106c4802a7.jpg.webp', 'sách', 'Bạn có thể biết Emmanuel Acho là người dẫn chương trình của loạt video đột phá Uncomfortable Conversations with a Black Man. Hoặc như một tác giả bán chạy nhất của New York Times. Hay như một phát thanh viên truyền hình từng đoạt giải Emmy. Hoặc với tư cách là cựu nhân viên hỗ trợ cho hai thương hiệu NFL.\r\nĐiều mà bạn có thể không biết là Emmanuel định nghĩa cuộc sống của chính mình chỉ bằng một từ: Phi lý trí.\r\nĐằng sau mọi chiến thắng, mọi biểu hiện về những món quà của mình, Acho đã phải phớt lờ thứ mà mọi người xung quanh gọi là “logic”: tỷ lệ thành công của việc thực hiện nó, rủi ro khi tiếp tục ước mơ lớn hơn hoặc khác đi. Thay vì chơi nó một cách an toàn, Acho đã ném ra ngoài cửa sổ những logic thông thường. Bây giờ, trong cuốn sách này, anh ấy trao quyền cho tất cả chúng ta để làm điều tương tự.\r\nCho dù đó là tạo ra một công ty khởi nghiệp đột phá, đấu tranh cho sự thay đổi với tư cách là một nhà hoạt động, hay cam kết với niềm đam mê cá nhân, “Logic của Phi lý trí” là cuốn sách phù hợp cho tất cả những độc giả sẵn sàng trở thành người tạo ra sự thay đổi. Với hướng dẫn từng bước để tìm ra lời kêu gọi và thay đổi tư duy, được làm sống động bởi những câu chuyện từ cuộc đời của Acho và những người tiên phong phi logic khác, và Kinh Thánh, Acho khuyến khích chúng ta thay thế các giới hạn xã hội đặt ra và những gì chúng ta tự đặt ra cho chính mình. Anh ấy cho chúng ta thấy những chân trời của chúng ta là vô tận.', 'sách', 'Sách Logic Của Phi Lý Trí - 1980Books - BẢN QUYỀN tiếng việt'),
	('2023-02-07 02:32:07.338501', 32, 112000, 35000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/bf/87/95/c943c5c65ede2780830da4306ed2e029.jpg.webp', 'sách', 'Sức Mạnh Của Hiện Tại được viết một cách súc tích và thâm thuý nên nhiều khi ta chỉ cần đọc một cây hay một đoạn ngắn thì đã cảm thấy vừa đủ, vì quả thực chúng ta cần có không gian để chiêm nghiệm những điều sâu sắc mà tác giả đã đưa ra. Nhờ sử dụng ngôn ngữ đương đại nên "Sức Mạnh Của Hiện Tại" dễ dàng đi vào lòng độc giả. Cuốn sách này có năng lực rất lớn để giúp bạn chuyển hoá khổ đau và đưa bạn đến giải thoát.\r\n"Sức Mạnh Của Hiện Tại" sẽ rất hữu ích và thực dụng nếu bạn đang có những khó khăn trong đời sống cá nhân, hay đời sống vợ chồng, cuốn sách này sẽ giúp bạn vượt qua những khó khăn đó, xây dựng lại mối quan hệ ngày một tốt đẹp hơn. Thậm chí quyển sách này còn có khả năng giúp bạn thực hiện những ước mơ, hoài bão sâu kín ở trong bạn bấy nay. Và xa hơn nữa, "Sức mạnh của hiện tại" có thể giúp bạn thực hiện được mục đích tối hậu của một con người là nhận thức được bản chất chân thực của mình là gì.', 'sách', 'Sức Mạnh Của Hiện Tại (Tái Bản) tiếng việt'),
	('2023-02-07 02:36:18.874137', 33, 54000, 20000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/77/43/c6/4a6f7f0d38eb4175180d4298843e7020.jpg.webp', 'sách', 'Bạn chưa đi làm, hoặc vừa mới chân ướt chân ráo bước vào chốn công sở, đã bao giờ bạn gặp phải tình huống như thế này: Khi cấp trên (hoặc thầy cô giáo) giao cho bạn một việc nào đó, ngay lập tức bạn ghi ghi chép chép rồi lao vào thực hiện. Chỉ tập trung làm cách nào để mau chóng hoàn thành nên bạn không nghĩ đến việc xác nhận lại với cấp trên (hoặc thầy cô) về mục tiêu chính của nhiệm vụ. Trong suốt quá trình thực hiện, bạn ít khi trao đổi với người khác, cũng không dành thời gian suy nghĩ, phân tích kĩ xem làm thế nào cho hiệu quả.  ', 'sách', 'Sách: 1 Ngày Bằng 48 Giờ - Sổ tay Quản Lí Thời Gian Hiệu Quả'),
