	('2023-02-07 02:49:56.223573', 44, 209000, 60000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/ca/ba/37/8ba497263ab463d630580e4b8ce21ee6.jpg.webp', 'đồ chơi', 'Rất đơn giản, chỉ cần cho giấy vào máy và sấy khô chung với quần áo đã giặt là có kết quả rồi. Thông thường một mẻ quần áo 7kg chỉ cần 3 đến 4 tờ là đủ rồi nhé. Nếu giặt tay không dùng máy, sau khi quần áo đã khô ráo, bạn đặt giấy thơm kẹp giữa các lớp vải và ủi đồ. Ở nhiệt độ cao, giấy thơm sẽ phát huy tác dụng hiệu quả nhất \r\n\r\n➤ Ngoài ra, với thiết kế dưới dạng giấy ép tỏa hương, bạn có thể sử dụng giấy thơm này cho các trường hợp:\r\n\r\n1. Khi bạn đặt một miếng Giấy Thơm Bounce ở gần nơi có kiến, chúng sẽ chạy đi hết.\r\n\r\n2. Tránh được mùi hôi mốc bằng cách kẹp một miếng giấy thơm vào sách hay cuốn album lâu ngày không mở ra.', 'giặt', 'Giấy thơm quần áo Bounce của mỹ Hộp 160 Tờ - Giúp lưu hương lâu trên quần áo và khử mùi ẩm mốc FAMACOCO'),
	('2023-02-07 02:50:20.341026', 45, 200000, 50000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/d8/22/89/22c0680308445c89a8552a90e99b96e4.jpg.webp', 'đồ chơi', 'Nước giặt ARIEL Cửa Trước Lựa chọn số 1 bởi Electrolux cho máy giặt cửa trước. \r\n- Với công thức ít bọt và khả năng làm sạch hoàn hảo, khử mùi hôi, ARIEL MATIC Cửa Trước là lựa chọn hoàn hảo cho công cuộc giặt giũ cùng máy giặt cửa trước của gia đình! ', 'giặt', 'Nước Giặt Ariel Cửa Trước Hương Downy Oải Hương Túi 3.05Kg'),
	('2023-02-07 02:50:58.880027', 46, 420000, 30000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/da/42/5d/5897815cab39339d47cd9335a779536d.jpg.webp', 'đồ chơi', 'Tã quần Bobby mới- Lõi nén thần kì 3mm- Siêu mỏng khô thoáng là cuộc cách mạng mới trong ngành tã trẻ em. Mỏng không tưởng - Thấm hút bất ngờ.\r\nVới công nghệ ép lõi đột phá từ Nhật Bản giúp tã :\r\nSiêu mềm, mỏng chỉ 3mm, thoáng khí gấp 2 lần mà vẫn thấm hút lượng lớn nước tiểu.\r\nThấm hút vượt trội và tuyệt đối không vón cục\r\nLớp đệm lưng siêu mềm với khả năng thấm mồ hôi tức thì, cho vùng lưng bé luôn khô thoáng.\r\nCấu tạo bề mặt đột phá lên tới 3.000 lỗ thấm siêu nhanh, cho tã luôn khô ráo và thoáng khí từ trong ra ngoài.\r\nHệ thun xốp- co giãn mềm mại\r\nDải băng dính cuốn miếng tã tiện lợi\r\nHương trà xanh Nhật Bản dịu mát.', 'baby', 'Tã quần Bobby Mega Jumbo M120 - Lõi nén thần kì 3mm - Siêu mỏng khô thoáng bất ngờ'),
	('2023-02-07 02:51:25.009092', 47, 534000, 300000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/e5/4c/73/5eeb91a3c42a3bad52ed69178abc2ebd.png.webp', 'đồ chơi', 'Tã quần UniDry siêu khô thoáng cải tiến mới – diện mạo mới , tăng cường thấm hút đến 20%, mỏng mềm hơn, bé mặc cưng – mẹ thêm ưng. Sản phẩm mang đến sự chăm sóc đầy yêu thương của mẹ dành cho bé bởi thiết kế dạng quần tiện lợi, thấm hút nhẹ êm, nâng niu làn da bé, cho em vui chơi suốt cả ngày dài mà không sợ hầm bí. Đặc biệt, tã quần Unidry có vạch báo tã đầy, hạn chế tối đa tình trạng không thoải mái của trẻ.', 'baby', 'Combo 2 tã quần em bé siêu khô thoáng UniDry - Tặng 2 gói khăn ướt Unifresh VitaminE 80M'),
	('2023-02-07 02:51:59.258546', 48, 218000, 55000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/1f/06/ef/5d699d008677ce730a577f4c7e05b6b4.jpg.webp', 'đồ chơi', 'Tã Dán Cho Bé Unidry (G6+) XL62 (62 miếng) với công nghệ sản xuất hiện đại, đáp ứng những tiêu chuẩn quốc tế khắt khe, sản phẩm tã dán mới UNIDRY BDP G6+: Chất Lượng Xuất Khẩu, SIÊU MỀM MỊN và thấm hút tốt hơn. Mặt lưng tã với chất liệu vải không dệt mềm cho da bé. Miếng dán và lưng thun êm ái. Bề mặt tã siêu mềm mại với các lỗ thoáng khí. Khả năng thấm hút vượt trội với các lõi hạt siêu thấm và kháng khuẩn, tăng 10% khả năng thấm hút lên đến 300ml. Hướng dẫn chọn Size: Size Cân nặng bé (kg) S 3-7(kg) M 6-11(kg) L 9-14(kg) XL Trên 13(kg)', 'baby', 'Tã Dán Cho Bé Unidry (G6+) Size XL62 (62 miếng)'),
