	('2023-02-07 04:12:51.872494', 54, 4090000, 2010000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/6d/d5/5c/e705d424f730e20fe8e4a0d76dfbea4b.jpg.webp', 'điện thoại', 'Sức mạnh mới, chơi game tuyệt đỉnh\r\n\r\nXiaomi Redmi Note 11 sử dụng bộ vi xử lý mới mạnh mẽ với 8 nhân tốc độ cao, mang đến hiệu suất lý tưởng cho mọi hoạt động. Dù là chạy các tác vụ phổ biến hay những tựa game đồ họa cao, Redmi Note 11 đều hoàn thành xuất sắc nhiệm vụ. CPU mạnh hơn 5% và GPU mạnh hơn 10% chắc chắn là tin rất vui cho các game thủ. Thoải mái tận hưởng không gian gaming trong lòng bàn tay một cách mượt mà, không giật lag.\r\n\r\nĐắm chìm trong màn hình lớn siêu mượt\r\n\r\nHãy thử xem một bộ phim hay video âm nhạc yêu thích trên Xiaomi Redmi Note 11, bạn sẽ cảm nhận ngay được sự ấn tượng khó quên. Diện tích hiển thị lên tới 6,5 inch, độ phân giải Full HD+ sắc nét, đồng thời tốc độ làm mới 90Hz mượt mà đến từng thao tác, mọi hiệu ứng chuyển cảnh, màu sắc trước mắt đều đẹp mỹ mãn. Màn hình này còn có tính năng điều chỉnh ánh sáng và nhiệt độ màu thông minh, để hình ảnh luôn phù hợp với môi trường xung quanh.', 'xiaomi', 'Điện thoại Xiaomi Redmi Note 11 (4GB/128GB)'),
	('2023-02-07 04:13:38.813626', 55, 3690000, 2000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/a6/de/4e/e96e2035f72c97c218ba9917f4e6d5ca.jpg.webp', 'điện thoại', 'Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....', 'oppo', 'Điện Thoại Oppo A57 (4GB/64GB)'),
	('2023-02-07 04:15:55.371377', 56, 13400000, 8000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/50/c1/c3/600fda9a8310cf43494cc5658f1aedbb.png.webp', 'điện thoại', 'Vivo V25 Pro sở hữu mặt lưng được làm bằng kính AG có thể đổi màu sắc độc đáo đi cùng màn hình AMOLED chất lượng, tích hợp theo đó là bộ vi xử lý MediaTek Dimensity 1300 mạnh mẽ, hứa hẹn sẽ trở thành tâm điểm, thu hút mọi ánh nhìn khi cầm trên tay. \r\nThiết kế trẻ trung, mặt lưng đổi màu độc đáo', 'vivo', 'Điện Thoại Vivo V25 Pro 5G (8GB/128G)'),
	('2023-02-07 04:17:17.640299', 57, 1690000, 1000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/5c/57/85/312c7a38df0312e7525a18f61c5a0fbc.jpg.webp', 'điện thoại', 'Nokia C30 là dòng smartphone giá rẻ được Nokia chăm chút và đầu tư kỹ lưỡng với những nâng cấp đáng kể cả về ngoại hình lẫn hiệu năng, hứa hẹn mang đến cho người dùng những trải nghiệm tuyệt vời hơn bao giờ hết.\r\n\r\nThiết kế cứng cáp, tao nhã\r\nĐiện Thoại Nokia C30 có thiết kế không quá khác biệt so với thế hệ Nokia C20. Với các góc được bo tròn hoàn hảo cùng logo Nokia nổi bật phía viền dưới màn hình, được chế tác hoàn toàn vừa vặn trong lòng bàn tay của bạn.', 'nokia', 'Điện Thoại Nokia C30 (2GB/32GB)'),
	('2023-02-07 04:17:54.213181', 58, 959000, 400000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/3c/49/33/cba5bb81199c8ee464d302b004a0b63a.jpg.webp', 'điện thoại', 'Trong thời buổi công nghệ, không chỉ người lớn mà trẻ em cũng cần trang bị bên người một thiết bị công nghệ để có thể nghe, gọi, lướt web. Điện thoại Sugar A100chính là sự lựa chọn thông minh khi được trang bị nhiều tính năng có thể đáp ứng nhu cầu học tập, giải trí của trẻ.', 'sugar', 'Điện thoại smartphone Sugar A100, music smartphone - Hàng chính hãng'),
	('2023-02-07 04:18:48.424055', 59, 6710000, 4500000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/51/3f/2e/bc48f6742c8ea97dc553180986df4243.jpg.webp', 'điện thoại', 'Hai năm sau khi tung ra mẫu Tab S6 Lite (năm 2020), nhà sản xuất Hàn Quốc đã âm thầm ra mắt Samsung Galaxy Tab S6 Lite (2022) với một vài cải tiến, đặc biệt là bộ vi xử lý mới.\r\nThiết kế mỏng nhẹ, màn hình lớn\r\nGalaxy Tab S6 Lite (2022) có thiết kế mỏng nhẹ cùng với mặt lưng kim loại để đem lại một vẻ ngoài cao cấp khi cầm nắm sử dụng, với kiểu thiết kế dạng nhám nhẹ mang lại cho người dùng khả năng hạn chế bám dấu vân tay và mồ hôi trong quá trình sử dụng.', 'samsung', 'Máy Tính Bảng Samsung Galaxy Tab S6 Lite (2022) (4GB/64GB) SM-P619'),
	('2023-02-07 04:19:48.006368', 60, 25000000, 15000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/6c/85/18/280943ff329fda4a57d3d42fc47b58e5.jpg.webp', 'điện thoại', 'Microsoft Surface Pro X SQ1/8G/256Gb SSD (Black)/ 13.0Inch Full HD 4GLTE/ Wifi/Bluetooth/Nano Sim Thiết kế cải tiến  Pro X SQ1 có một số thay đổi tinh tế trong thiết kế như màn hình lớn hơn. Dù với kích thước màn là 13 inch lớn hơn, nhưng vẫn mỏng hơn và nhẹ hơn so với các mẫu Surface Pro có màn hình 12 inch mà chúng ta thường sử dụng. Thiết bị cũng có bộ xử lý Surface SQ1 dựa trên ARM mới bên trong, một con chip đã được hợp tác giữa Microsoft và Qualcomm. Điểm thay đổi lớn nhất trên sản phẩm chính là viền bezel mỏng hơn, các cạnh tròn hơn và tổng thể mỏng hơn. Microsoft đã đặt hai cổng USB-C ở phía bên trái và cổng sạc Surface Connect truyền thống ở phía bên tay phải.  Surface Pro X được trang bị màn hình PixelSense 13 inch (2880 x 1920) với tỷ lệ khung hình 3: 2 thông thường. Do mỏng hơn nên việc cầm nắm thiết bị trở nên dễ dàng hơn nhiều so với Surface Pro 7. Cụ thể Surface Pro X chỉ dày 7,3mm so với 8,38mm trên Pro 7 và nhẹ hơn rất nhiều với trọng lượng 774 gram so với Pro 7 nặng 775 gram. Mặc dù sự khác biệt trọng lượng không nhiều nhưng độ mỏng tốt hơn nên bạn sẽ cảm thấy nhẹ hơn rất nhiều về tổng thể. Slim Pen Biến Surface Pro X thành một chiếc máy tính xách tay và thậm chí khiến mọi thứ trở nên dễ dàng hơn khi sử dụng cùng với Slim Pen. Chiếc bút được lưu trữ an toàn và sạc lại trong bàn phím bọc Alcantara sang trọng, hoàn chỉnh với các phím có đèn nền và bàn di chuột bằng kính tinh tế. Chiếc máy tính bảng như một chiếc laptop chính hiệu Microsoft Surface Pro X SQ1/8G/256Gb (Black) bản thân là một chiếc  nhưng khi kết hợp với  lập tức trở thành một chiếc  hiệu suất ấn tượng để đáp ứng các nhu cầu sử dụng cho công việc hàng ngày của bạn. Học tập, làm việc ghi chú theo phong cách hiện đại khi kết hợp sử dụng với bút , tất cả đã sẵn sàng để mang đến cho bạn một thiết bị hỗ trợ hoàn hảo. Cấu hình đầy ngạc nhiên Surface Pro X sử dụng một nền tảng ARM được sản xuất chặt chẽ với Qualcomm. Microsoft cho biết họ đã tạo ra tuỳ chỉnh là Snapdragon DNA, kết hợp với A.I – Bộ tăng tốc dùng để tạo ra một chipset hoàn toàn tùy chỉnh có tên là Microsoft  SQ1. Bộ xử lý Microsoft SQ1 tùy chỉnh bên trong Surface Pro X sẽ giúp bạn bắt kịp mọi thứ trong cuộc sống hiện đại. Từ sử dụng các ứng dụng cơ bản đến duyệt web mượt mà, cộng với các cuộc trò chuyện video chất lượng cao, phát trực tuyến Duy trùy năng suất, tiết kiệm thời gian và được kết nối gần như mọi lúc, mọi nơi. Ở phiên bản này Microsoft Surface Pro X được trang bị RAM lên tới 8GB, SSD 256GB giúp cho máy lưu trữ và xử lý dữ liệu dễ dàng, nhanh chóng.', 'microsoft', 'Máy tính bảng Microsoft Surface Pro X (13/ SQ1TM/ 8GB/ 256GB SSD/ WiFi + 4G LTE/ Black) Model QWZ-00001'),
	('2023-02-07 04:20:27.852110', 61, 21000000, 14000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/f7/0c/cf/856e18e7291fdf74cf543be4d32ccaa8.png.webp', 'điện thoại', 'Phụ kiện được bán riêng và tùy thuộc nguồn hàng có sẵn. Khả năng tương thích tùy thuộc thế hệ sản phẩm. Ứng dụng có sẵn trên App Store. Nội dung được cung cấp có thể thay đổi. Phần mềm bên thứ ba được bán riêng.\r\n\r\n1Màn hình có các góc bo tròn. Khi tính theo hình chữ nhật, kích thước màn hình iPad Pro 11 inch theo đường chéo là 11 inch. Diện tích hiển thị thực tế nhỏ hơn.\r\n\r\n2Wi-Fi 6E không khả dụng tại Trung Quốc đại lục và Nhật Bản.\r\n\r\n3Thời lượng pin khác nhau tùy theo cách sử dụng và cấu hình. Truy cập apple.com/batteries để biết thêm thông tin.\r\n\r\nThông số kỹ thuật\r\nTruy cập apple.com/ipad-pro/specs để xem cấu hình đầy đủ.', 'apple', 'Apple iPad Pro 11-inch M2 Wi-Fi, 2022'),
	('2023-02-07 04:21:27.321308', 62, 3500000, 1500000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/5a/f2/36/90f4fae6dc87e39d2534831bc24aa1be.jpg.webp', 'điện thoại', 'Hiệu suất hoạt động mạnh mẽ\r\nBộ vi xử lý 8 nhân có tần số lên đến 1,6 GHz và RAM 3 GB mang lại hiệu năng mạnh mẽ hơn, cho phép bạn chuyển đổi liên tục giữa các ứng dụng và trò chơi mượt mà, nhanh chóng.', 'vankyo', 'Máy tính bảng VANKYO MatrixPad S30 - Hàng Chí'),
	('2023-02-07 04:21:27.321308', 63, 8679000, 5210000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/fc/f3/0e/bcb04712f34c9c6ee327b9bc95c10b22.jpg.webp', 'điện thoại', 'Bản nâng cấp của Kobo Forma mới ra mắt, mở bán lần đầu trên thế giới ngày 20/10/2021. Libra 2 và Sage là những chiếc máy đọc được mong chờ nhất cuối năm 2021.\r\n\r\n \r\n\r\nĐẶC TRƯNG CỦA DÒNG MÁY:\r\n\r\nKÍCH THƯỚC MÀN: Sage và Forma với kích thước 8inch (16cmx12.5cm) so với dòng 7inch (14*10.5cm) diện tích lớn hơn 36%. Trang hiện thị tỷ lệ như 1 trang giấy thực sự cho cảm giác mướt mắt với những người hay đọc tài liệu PDF, truyện tranh.\r\nCHIP XỬ LÝ: lõi 4, tốc độ gần gấp 2 Libra2, mạnh mẽ với ưu thế hiệu năng đảm bảo trơn mượt khi làm việc với các file PDF nặng, lướt web đọc báo và download sách nhanh như như 1 chiếc máy tính bảng đời mới không hề có độ trễ.', 'sage', 'Máy đọc sách Kobo Sage'),
