	('2023-02-07 04:42:23.427665', 67, 195000, 120000, 100, 'https://salt.tikicdn.com/cache/750x750/media/catalog/producttmp/b1/27/59/dd929396a3a58056da5a1d52ed047e78.jpg.webp', 'làm đẹp', 'Bao Cao Su Durex Performa 12S 278230 (12 Cái / Hộp) được thiết kế đặc biệt để giúp kéo dài cuộc yêu. Durex Performa chứa benzocain 5% giúp trì hoãn cực khoái và kéo dài thời gian cương cứng, cho bạn điều khiển cuộc yêu theo cách của riêng mình. Bao cao su kéo dài thời gian quan hệ Durex Performa là bí quyết tuyệt vời để giữ lửa cuộc yêu.\r\n\r\nCuộc sống tình dục của bạn rất quan trọng. Tình dục là bản năng và nhu cầu tự nhiên của con người, ngoài chức năng duy trì nòi giống thì đời sống tình dục viên mãn còn mang nhiều lợi ích cho sức khỏe. Vì vậy bạn cần hiểu rõ về cấu trúc tình dục của cơ thể mình, các phương pháp tránh thai thích hợp và nhất là', 'bao cao su', 'Bao cao su Durex Performa 12 bao'),
