	('2023-02-07 06:13:14.775766', 70, 2529000, 1600000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/7c/be/f3/6bd786e80dc729e7329a3ce12de50b78.jpg.webp', 'điện gia dụng', 'Tùy từng lô hàng sẽ là sản phẩm sẽ có tiếng anh/ tiếng việt, Tuy nhiên sẽ luôn luôn có sách hướng dẫn tiếng việt cho quý khách hàng dễ dàng thao tác và sử dụng nấu những món ngon cho gia đình bạn\r\n\r\nCông suất : 1000W\r\nDung tích : 6L\r\nLòng nồi chống dính dày lên đến 1,5mm\r\nVan xả hơi dễ dàng sử dụng, an toàn tuyệt đối cho người tiêu dùng\r\nThực đơn nấu đa dạng lên đến 15 chức năng cài đặt sẵn + 2 chế độ nấu đặc biệt.\r\nVỏ bên ngoài bằng nhựa cách nhiệt, an toàn khi sử dụng \r\n12 chế độ an toàn , an tâm tuyệt đối khi sử dụng ', 'tefal', 'Nồi áp suất điện đa năng 6L Tefal'),
	('2023-02-07 06:13:58.877044', 71, 1895000, 1000000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/7c/20/66/dc3945bdee6b6932e7bc325ec7254265.jpg.webp', 'điện gia dụng', 'Mặt trước nồi viền Inox: Bền, đẹp, chống trầy xước.\r\n\r\nRổ chiên và khay hứng dầu bằng hợp kim nhôm (FAL) phủ lớp chống dính Greblon từ Đức, bền bỉ và an toàn khi tiếp xúc với thực phẩm.\r\n\r\nBảng điều khiển điện tử cảm ứng - màn hình LED với 8 chế độ nấu được cài đặt sẳn, sang trọng và hiện đại.\r\n\r\nTiện ích với chế độ làm nóng lòng nồi "P" riêng biệt trước sử dụng.\r\n\r\nCài đặt thời gian lên đến 60 phút. tự động ngắt khi kết thúc.\r\n\r\nDung tích lòng nồi 5,5 Lít phù hợp để chiên/nướng nhiều loại thực phẩm lớn và dày.\r\n\r\nTự ngắt điện khi tháo lòng nồi và ghi nhớ chương trình nấu.', 'BlueStone ', 'Nồi Chiên Không Dầu Điện Tử BlueStone AFB'),
	('2023-02-07 06:14:35.095236', 72, 483000, 210000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/94/18/62/b3050ee2f66d267d8cb10349944849ea.png.webp', 'điện gia dụng', 'Thành phần: Hợp kim nhôm, mặt trong phủ 2 lớp chống dính PFLUON (tạo bề mặt vân đá); mặt ngoài phủ sơn chịu nhiệt, tay cầm nhựa bakelite, đáy inox dùng được trên bếp từ.\r\n\r\nHướng dẫn bảo quản	\r\nHướng dẫn bảo quản: Để sản phẩm nơi khô mát sau khi sử dụng. Không dùng vật nhọn, sắc vệ sinh sản phẩm. Không ngâm, rửa khi chảo còn đang nóng.', 'chảo', 'Chào SUPER CHEF black & green h.kim chống dính đáy từ tiện lợi, bền bỉ, dùng được cho mọi loại bếp'),
	('2023-02-07 06:15:07.407388', 73, 547000, 300000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/6f/9f/e1/c526094038b8546d96fbafab1a475710.jpg.webp', 'điện gia dụng', 'Công suất : 1350W Xuất xứ: Trung Quốc Điện áp 220V – 50Hz Dung tích thiết kế: 6l THÔNG TIN SẢN PHẨM: -Nồi chiên không dầu Camel Dung tích lớn 6l tiện lợi để chiên được nhiều loại thực phẩm khác nhau như: cá, thịt, khoai tâ - Công nghệ mới cho phép bạn rán, nướng bánh, nướng và quay thực phẩm nhanh chóng, ít chất béo hơn so với nồi chiên thông thường nhờ việc sử dụng không có dầu, an toàn cho sức khỏe - Sản phẩm nồi chiên không dầu camel 6l có ngăn kéo phủ lớp chống dính có thể tháo rời và giỏ thức ăn có thể rửa được bằng máy rửa chén, giúp việc vệ sinh máy trở nên dễ dàng. - Chức năng hẹn giờ tích hợp cho phép bạn đặt sẵn thời gian nấu lên đến 30 phút. Điều khiển nhiệt độ có thể điều chỉnh cho phép bạn đặt trước nhiệt độ nấu phù hợp với thức ăn lên đến 200 độ C - Với sản phẩm nồi chiên không dầu camel 6l, bạn có thể sử dụng để chiên nướng nhiều món ăn từ nhiều loại thực phẩm khác nhau đều tiện dụng như chiên khoai tây, gà rán, mực chiên xù, thị - Dung tích thiết kế với dung tích lên đến 6l lít giúp bạn có thể chiên nướng thức ăn với khối lượng lớn dành cho nhiều người, có thể thực hiện những món ăn ở dạng khối như gà, vị - Chất liệu lòng nồi bằng kim loại phủ Ceramic cao cấp có khả năng chống dính, chống trầy xước và chống oxy hóa mang đến sự bền bỉ khi nấu nướng và đảm bảo vấn đề an toàn thực phẩm. - Được cài đặt với chuông báo khi chương trình nấu nướng kết thúc sẽ giúp bạn dễ dàng kiểm soát được quá trình hoạt động của nồi, tiết kiệm được thời gian và công sức chuẩn bị. Núm xoay điều chỉnh thời gian và nhiệt độ nấu nướng sẽ giúp bạn dễ dàng hơn với các thao tác khi sử dụng. - Lòng nồi chiên không dầu camel 6l dễ dàng tháo lắp tạo sự thuận tiện cho bạn khi chùi rửa và bảo quản nồi. - Khi hoạt động, nồi chiên không sản sinh khói, chất thải độc hại ra môi trường góp phần bảo vệ môi trường. 