	('2023-02-07 07:06:10.468482', 100, 194000, 70000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/dd/45/fd/59df2796e4a621bd05378591f097d0ac.jpg.webp', 'giày nữ', 'Thích hợp đi chơi, dự tiệc. Màu sắc sang trọng, tao nhã, dễ dàng phối với các trang phục khác nhau như: Quần short, jean, váy, đầm dạo phố, jump. Nổi bật và tôn lên nét quyến rũ của các bạn gái. Thân giày mềm mại, ôm chân mà không làm đau chân, giúp các bạn vững vàng, tự tin sải bước. Một đôi giày có thể mang cùng với nhiều loại trang phục thì quả là vừa thời trang, vừa ưu việt quá phải không nào?\r\n- Kiểu dáng nữ tính gọn nhẹ: Thích hợp với các bạn trẻ dễ phối đồ , cá tính, phù hợp với mọi lúc mọi nơi , đi chơi đi làm việc ,\r\n- Chất liệu : da , đế mềm, có thể uốn cong mà không bị gãy mép.\r\n- Giày Nữ size từ: 35 đến 40 với 2 màu khác nhau\r\n- Đế giày với các lớp cao su có độ đàn hồi cao, các đường rãnh ma sát được xẻ và bố trí dưới mặt đế một cách khoa học, giúp giày luôn êm ái khi sử dụng và không bị vướng, mắc các loại rác, sỏi, đá khi sử dụng.\r\n- Giày có khả năng chống trơn, chịu mài mòn tốt, thoáng khí, nhanh khô\r\n- Tăng thêm chiều cao 2cm', 'giày nữ', 'Giày Lười Nữ , Giày Mọi Nữ , Giày Búp Bê Nữ'),
	('2023-02-07 07:07:10.909957', 101, 239000, 50000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/25/88/86/53dc8c8cf7e013a5436c6f3aa04fbc27.jpg.webp', 'giày nữ', 'CHÚ Ý: GIÀY FORM NHỎ, CHỊ EM ĐẶT TĂNG LÊN 1 SIZE GIÚP SHOP NHA\r\n\r\nGIÀY THỂ THAO NỮ HÀN QUỐC LOẠI CAO CẤP CHỐNG HÔI CHÂN ĐẾN 99%\r\n\r\nGiày nữ trắng độn đế loại cao cấp giúp tôn chiều cao, SIÊU ÊM - SIÊU ĐẸP - SIÊU BỀN\r\n\r\n+ Giày cao 8.5 phân ( trong đó phần đế phía dưới cao 5cm, còn lót giày phía trong cao 3.5cm).', 'giày nữ', 'Giày thể thao nữ độn đế, sneaker'),
	('2023-02-07 07:07:47.829473', 102, 336000, 100000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/fa/99/89/312e87e36701b7ae05c130397848ee5e.jpg.webp', 'giày nữ', 'Giày nữ là 1 món đồ thời trang không thể nào thiếu trong tủ đồ của các chị em của chúng ta đúng không nào, hiện nay trên thị trường có rất nhiều dòng giày cho chị em mình lựa chọn từ giày sneaker, giày thể thao, già sục, giày đế cao, giày nữ độ đế, vải nữ, giày boot thế nhưng giày thể thao nữ được rất nhiều bạn nữ ưa chuộng và sử dụng cho nhiều sử dụng cho nhiều mục đích khác nhau.\r\n\r\nKhác với những dòng giày thể thao nữ truyền thống, giày sneaker nữ hiện nay đa dạng mẫu mã, thiết kế trẻ trung và có thể vừa chơi thể thao như chạy và đi bộ tập GYM, ngoài ra có thể mang đi chơi , du lịch và nó cực kì dễ dàng phối được rất nhiều quần áo khác nhau từ đầm váy cho đến quần jean ống mục đích khác nhau.', 'giày nữ', 'Giày thể thao nữ sneaker đế xuồng'),
	('2023-02-07 07:08:44.085617', 103, 269000, 100000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/4f/11/f5/4cbb1af15bb7f4a6cae1538c24d1c1cd.jpg.webp', 'giày nữ', 'Giày Sandal The Bily  sản xuất theo công nghệ cao và hàng đầu tại Việt Nam, được thiết kế dành cho các bạn yêu thích sự tối giản, trẻ trung và tiện lợi.\r\n \r\nGiày Sandal Nữ The Bily 01W Quai Chéo với thiết kế đơn giản nhưng không kém phần lịch thiệp, kiểu dáng và màu sắc trẻ trung, nhẹ nhàng giúp bạn dễ dàng phối với những outfits riêng của mình.\r\n ', 'giày nữ', 'Giày Sandal Nữ The Bily 01W'),
	('2023-02-07 07:09:15.733265', 104, 299000, 100000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/fa/54/38/e1d35a03e14a0e4cdd5a29976ff12df9.jpg.webp', 'giày nữ', 'Sandal Nữ với chất liệu da bò bền đẹp kết hợp đế cao su êm nhẹ chống trơn trượt giúp bạn Nữ luôn thoải mái, tự tin khi đi chơi, dạo phố, đi làm nơi công sở hay đi dự tiệc.\r\n\r\nSandal Nữ được xử lý đặc biệt để tạo độ bóng mờ, Phong cách trẻ trung và Nữ tính.\r\n\r\nĐế cao: 2cm\r\n\r\nChất liệu: Da bò thật 100%\r\n\r\nĐế cao Su cao cấp chẳng những êm ái mang lại sự thoải mái tối đa cho người dùng, mà mặt đế còn có độ bám tốt để bạn có thể sải bước thật vững vàng và tự tin.', 'giày nữ', 'Giày sandal nữ kẹp da bò thật cao cấp'),
	('2023-02-07 07:11:11.396470', 105, 550000, 200000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/a9/e7/b8/b37fe4f6b3d3fa50ccdce8d8d9fee21e.jpg.webp', 'giày nữ', '- Thương hiệu: rosata\r\n- Mã sản phẩm: ro301\r\n- Kiểu dáng: Giày boot nữ\r\n- Chất liệu: được làm từ da tổng hợp cao cấp đảm bảo mang mềm và êm chân\r\n- Size: 34, 35, 36, 37, 38, 39, 40\r\n- Chiều cao: 4 phân\r\n- Màu: đen và trắng\r\n- xuất xứ: việt nam\r\n- Hàng luôn có tại kho của shop nên thời gian giao hàng đến tay các bạn cũng sẽ được ngắn đi rất nhiều', 'giày nữ', 'Giày boot nữ cổ thấp 4 phân hàng hiệu rosata hai màu đen trắng ro301'),
	('2023-02-07 07:12:10.982333', 106, 690000, 200000, 100, 'https://salt.tikicdn.com/cache/750x750/ts/product/e1/fb/ea/d5b2f5ccacfb371ae4842b6c1df6bb59.jpg.webp', 'giày nữ', '- Được làm bằng chất liệu da bò thật 100%, chất da bóng đẹp, càng dùng càng bóng. Với các loại da bò thật khi khách hàng đi vào sẽ mềm hơn, trong quá trình sử dụng đánh xi để làm mới lại sản phẩm. \r\n\r\n- Lót lông bên trong tạo cảm giác êm ái và ấm áp trong mùa đông lạnh giá của các chị.\r\n\r\n- Gót cao 5 phân trẻ trung dễ mang.\r\n\r\n- Kiểu dáng sang chảnh dễ phối đồ, kết hợp với váy, quần đều đep.\r\n\r\n- Form giày may đúng tiêu chuẩn, đem lại sự thoải mái khi mang.\r\n\r\n- Chất liệu keo được dùng cho thị trường xuất khẩu nên rất chắc chắn, độ bền cao.', 'giày nữ', 'Boot Da Bò BN101 HT.NEO Làm Từ Da bò thật 100%, Càng Dùng Càng Bóng, Gót Trụ Cao Đén 5cm');
